import React from 'react'
import { Breadcrumb } from 'antd';
import { NavLink, useLocation } from 'react-router-dom';

export default function Header() {

    const location = useLocation();
    const breadcrumbNameMap = {
        '/crm/customer': 'Quản lý khách hàng',
        '/crm/customer/create': 'Thêm khách hàng',
        '/crm/customer/update': 'Cập nhật khách hàng',
        '/crm/contract': 'Quản lý hợp đồng',
        '/crm/contract/create': 'Tạo hợp đồng',
    };
    const pathSnippets1 = location.pathname.replace("/crm","");
    const pathSnippets = pathSnippets1.split('/').filter((i) => i);
    const extraBreadcrumbItems = pathSnippets.map((_, index) => {
        const url = `/crm/${pathSnippets.slice(0, index + 1).join("/")}`;
        return (
          <Breadcrumb.Item key={url}>
            <NavLink to={url}>{breadcrumbNameMap[url]}</NavLink>
          </Breadcrumb.Item>
        );
      });
      const breadcrumbItems = [
        <Breadcrumb.Item key="home">
          <NavLink to="/">Hợp đồng</NavLink>
        </Breadcrumb.Item>,
      ].concat(extraBreadcrumbItems);

    const imgBase64 = ""
    
  return (
    <div className="header">
        <div className="header__infor">
            <div className="header__avtar">
                <img src={`data:image/jpeg;base64,${imgBase64}`} alt="avatar of user" />
            </div>
            <p>Chào, <span>{"Chung"}</span></p>
            <svg width="21" height="21" viewBox="0 0 21 21" fill="none" xmlns="http://www.w3.org/2000/svg">
                <path d="M13.244 5.618V4.685C13.244 2.65 11.594 1 9.559 1H4.684C2.65 1 1 2.65 1 4.685V15.815C1 17.85 2.65 19.5 4.684 19.5H9.569C11.598 19.5 13.244 17.855 13.244 15.826V14.883" stroke="#200E32" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                <path d="M20.0375 10.25H7.99646" stroke="#200E32" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
                <path d="M17.1093 7.33472L20.0373 10.2497L17.1093 13.1657" stroke="#200E32" strokeWidth="1.5" strokeLinecap="round" strokeLinejoin="round"/>
            </svg>
        </div>
        <div className="header__beadrum">
            <Breadcrumb separator=">>">
                {breadcrumbItems}
            </Breadcrumb>
        </div>
    </div>
  )
}
